import React from 'react';
import {Col, Container} from "react-bootstrap";
import TypeBar from "../components/TypeBar";
import Row from "react-bootstrap/Row";

const Shop = () => {
    return (
        <Container>
            <Row className="mt-2">
                <Col md={3}>
                    <TypeBar />
                </Col>
                <Col md={3}>

                </Col>
            </Row>
        </Container>
    );
};

export default Shop;
